    "    - affected: number of people affected\n",
    "    - damage_inr: damage cost in INR\n",
    "    \n",
    "    Returns:\n",
    "    - Predicted class (e.g., High Impact / Low Impact)\n",
    "    \"\"\"\n",
    "    import numpy as np\n",
    "    \n",
    "    # Compute engineered features\n",
    "    fatality_rate = deaths / (affected + 1)\n",
