    "    \n",
    "    # Create input array\n",
    "    X_input = np.array([[deaths, affected, damage_inr, disaster_impact, fatality_rate]])\n",
    "    \n",
    "    # Predict\n",
    "    prediction = model.predict(X_input)[0]\n",
    "    \n",
    "    return prediction\n"
